const List = () => {
  return (
    <div><div style={{display:"flex",justifyContent:"space-evenly",flexWrap:"wrap",margin:"20px"}}>
    {products.map((el) => (
      <Product el={el} key={el._id} />
    ))}
  </div></div>
  )
}

export default List
